import React from 'react'

function Card(props) {
  return (
    <div className='card'>
      <div className='top'>
        <img className='circle-img'
        src={require(`${props.img}`)} 
        alt="pokepic"/>
            <p className='name'>
                {props.name}
            </p>
      </div>
      <div className='bottom'>
        <p>
            {props.text}
        </p>
        </div>
    </div>
  )
}

export default Card
